import React, { useEffect, useState, useCallback } from 'react';
import { Link } from 'react-router-dom';
import HomeHeader from './HomeHeader';
import ApiService from '../../ApiService';
import closetImage from '../../assets/closet.jpg';
import styles from './Home.module.css';

const Home = () => {
  const [featuredProducts, setFeaturedProducts] = useState([]);
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState(null);

  const fetchProductsHandler = useCallback(async () => {
    setIsLoading(true);
    setError(null);
    try {
      const response = await ApiService.fetchProducts();
      if (response.status < 200 || response.status >= 300) {
        throw new Error('상품을 불러오는 데 실패했습니다.');
      }
      const data = response.data?.content || [];

      const sortedProducts = data
        .filter((product) => product.judge !== 'NULL')
        .sort((a, b) => b.judge - a.judge)
        .slice(0, 3);

      setFeaturedProducts(sortedProducts.length > 0 ? sortedProducts : data.slice(0, 3));
    } catch (err) {
      setError(err.message || '상품을 불러오는 데 실패했습니다.');
    } finally {
      setIsLoading(false);
    }
  }, []);

  useEffect(() => {
    fetchProductsHandler();
  }, [fetchProductsHandler]);

  return (
    <div className={styles.homeContainer}>
      <HomeHeader />
      
      <main>
        <section className={styles.banner}>
          <div className={styles.overlay}></div>
          <h1 className={styles.bannerTitle}>옷피셜. 세상에 없던 AI 쇼핑몰</h1>
          <img src={closetImage} alt="옷장 이미지" className={styles.bannerImage} />
        </section>

        <nav className={styles.categoryMenu}>
          <Link to="/products">상품목록</Link>
          <Link to="/category2">카테고리 2</Link>
          <Link to="/category3">카테고리 3</Link>
          <Link to="/category4">카테고리 4</Link>
        </nav>

        <section className={styles.featuredProducts}>
          <h2>추천 상품</h2>
          {isLoading && <p>로딩 중...</p>}
          {error && <p className={styles.error}>{error}</p>}
          {!isLoading && !error && (
            <div className={styles.productList}>
              {featuredProducts.map((product) => (
                <div key={product.productCode} className={styles.productCard}>
                  <Link to={`/products/${product.productCode}`} className={styles.imageContainer}>
                    <img src={product.productImg[0]} alt={product.productName} className={styles.productImage} />
                  </Link>
                  <div className={styles.productContent}>
                    <h3 className={styles.productName}>{product.productName}</h3>
                    <div className={styles.priceSection}>
                      {product.rprice > 0 ? (
                        <>
                          <div className={styles.originalPrice}>{product.oprice.toLocaleString()} 원</div>
                          <div className={styles.discountWrapper}>
                            <span className={styles.discountPercentage}>
                              {Math.round(((product.oprice - product.rprice) / product.oprice) * 100)}%
                            </span>
                            <span className={styles.salePrice}>{product.rprice.toLocaleString()} 원</span>
                          </div>
                        </>
                      ) : (
                        <div className={styles.salePrice}>{product.oprice.toLocaleString()} 원</div>
                      )}
                    </div>
                  </div>
                </div>
              ))}
            </div>
          )}
        </section>
      </main>

      <footer className={styles.footer}>
        <p>&copy; 2024 옷피셜. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default Home;
